//上のSwith文をIf文に書き換えた場合
let num = 1;
if (num === 1) {
    console.log('Gold');
}
else if (num === 2) {
    console.log('Silver');
}
else if (num === 3) {
    console.log('Bronze');
}
else if (num === 4) {
    console.log('4th');
}
else if (num === 5) {
    console.log('5th');
}
else {
    console.log('Other');
}
